import React, { Component } from 'react';

class GameHeader extends Component {
    render() {
        return (
            <div style={{
                display: 'flex',
                justifyContent: 'center'
            }}>
                <h1>KeySword</h1>
            </div>
        )
    }
}
export default GameHeader;
